import './watchedcard.css';
import React from 'react'
import MovieControls from '../../Watchlist/watchlistcard/MovieControls';

const WatchedCard = ({movie,type}) => {
  return (
    <div className='Watched-Card'>
      <img src={movie.Poster} alt="" />
      <h2>{movie.Title}</h2>
      <MovieControls movie={movie}/>
    </div>

  )
}

export default WatchedCard
